import React from 'react';
import ReactDOM from 'react-dom';
import Home from './main/home';
import Navbar from './main/navbar';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

ReactDOM.render(
  <>
    <Navbar />
    <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/topics">
            <Topics />
          </Route>
          <Route path="/">
            <Home />
          </Route>
    </Switch>

  </>,
  document.getElementById('root')
);
